// search - map 표시 
import { Map } from "react-kakao-maps-sdk";
import { useState } from 'react';
import style from './Food.module.css';

const Mymap = () => {

    return (
        <div className={`${style.kakaoMap}`}>
            <Map // 지도를 표시할 Container
                center={{
                    // 지도의 중심좌표
                    lat: 33.450701,
                    lng: 126.570667,
                }}
                style={{
                    // 지도의 크기
                    width: "500px",
                    height: "450px",
                }}
                level={3} // 지도의 확대 레벨
            />
        </div>
    );
}
export default Mymap;
